import './App.css';
import {Button} from '@material-ui/core';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
      <Router>
          <Link class="btn gradient-border">View Work</Link>
          <Link class="btn gradient-border">About Me</Link>
          </Router>
    </div>
  );
}

export default App;
